import './App.css';
import "./style/Navbar.css";


function App() {
  return (
    <div className="App">
      <div className="navbar">
        <span className="navbar-logo" style={{marginTop : "20px"}}>
            <img src="./logo.png" id="logo-link" alt ="None"/>
            <input type="text" name="searchKeyword" id="searchKeyword" title="통합검색창"></input>
            ></span>
      </div>

    </div>
  );
}

export default App;
